import React from 'react';
import NavBar from 'parts/navbar/NavBar';
import HeaderBar from 'parts/header-bar/HeaderBar';
import RayaLogo from 'assets/media/raya-logo.svg';
import './dashboard.css';

const Dashboard = () => (
  <div id="dashboard">
    {/* <div className="box"> */}
      <img className="raya-logo p-1" src={RayaLogo} alt="raya-logo" />
    {/* </div> */}
    <HeaderBar />
    <NavBar />
    <div className="raya-dashboard-body box">
      Dashboard
    </div>
  </div>
);

export default Dashboard;
